import "./App.css";
import { useEffect,useState } from "react";
import Axios from "axios";
import Coin from "./components/Coin";

function App() {
  const [listOfCoins, setListOfCoins] = useState([]);


  useEffect(() => {
    Axios.get("https://api.coinstats.app/public/v1/coins?skip=0&limit10").then(
      (response) =>{
      setListOfCoins(response.data.coins);
    })
  }, []);

 return(
          <div className="App">
              <div className="cryptoDispla">{listOfCoins.map((coin) =>{
                return <Coin>{coin.name}</Coin>
              })}</div>
          </div>
 );
}
export default App;
